INSERT IGNORE INTO `profile` (`id`, `title`, `description`, `img_header`, `status`, `created_at`, `updated_at`, `deleted_at`) VALUES
	(1, 'Simbol Paroki', '<h1 style="text-align: center;"><span style="font-weight: bolder;"><span style="font-size: 36px;">SIMBOL &amp; MAKNA</span></span></h1><h2 style="text-align: center;"><span style="font-weight: bolder;"><span style="font-size: 24px;"><br></span></span></h2><p style="text-align: center;"><img src="data:image/png;base64," data-filename="Logo Paroki_Latar Transparan.png" style="width: 506.078px;"></p><hr><p style="text-align: center;"><span style="font-weight: bolder;"><span style="font-size: 24px;"><br></span></span></p><p style="color: rgb(133, 135, 150);"><span class="OYPEnA text-decoration-none text-strikethrough-none" style="font-size: 18px;"><font color="#000000"><span style="font-weight: bolder;">1. Sosok Pelindung Paroki</span></font></span></p><p style="color: rgb(133, 135, 150); margin-left: 25px;"><span style="font-size: 18px; font-family: Nunito;"><font color="#000000">Sebuah ekspresi figuratif dari Santo Blasius sebagai pelindung paroki, ditampilkan dengan figur berjubah, memegang sebuah kitab, dan nimbus mengelilingi kepala.</font></span></p><hr style="color: rgb(133, 135, 150);"><p style="color: rgb(133, 135, 150);"><span class="OYPEnA text-decoration-none text-strikethrough-none" style="font-size: 18px;"><span style="font-weight: bolder;"><font color="#000000">2. Nimbus</font></span></span></p><p style="color: rgb(133, 135, 150); margin-left: 25px;"><span style="font-size: 18px;"><font color="#000000">Lingkaran yang mengelilingi kepala menunjukkan kemuliaan Ilahi yang ada dalam diri Santo Blasius, pelindung paroki.</font></span></p><p style="color: rgb(133, 135, 150);"></p><hr style="color: rgb(133, 135, 150);"><p style="color: rgb(133, 135, 150);"><span class="OYPEnA text-decoration-none text-strikethrough-none"><span class="OYPEnA text-decoration-none text-strikethrough-none" style="font-size: 18px;"><span style="font-weight: bolder;"><font color="#000000">3. Kitab Suci</font></span></span></span></p><p style="color: rgb(133, 135, 150); margin-left: 25px;"><span class="OYPEnA text-decoration-none text-strikethrough-none"><span class="OYPEnA text-decoration-none text-strikethrough-none" style="color: rgb(0, 0, 0);"><span class="OYPEnA text-decoration-none text-strikethrough-none" style="font-size: 18px;">Kitab Suci&nbsp;</span></span></span><span style="color: rgb(0, 0, 0); font-size: 18px;">disimbolkan sebagai fondasi iman akan firman tuhan untuk dijadikan pedoman akan penyebaran kasih dan semangat kristus.</span><br class="Apple-interchange-newline"></p><hr style="color: rgb(133, 135, 150);"><p style="color: rgb(133, 135, 150);"><span style="font-weight: bolder; font-size: 18px;"><font color="#000000">4. Salib</font></span><br></p><p style="color: rgb(133, 135, 150); margin-left: 25px;"><span class="OYPEnA text-decoration-none text-strikethrough-none"></span></p><p style="color: rgb(133, 135, 150); margin-left: 25px;"><span class="OYPEnA text-decoration-none text-strikethrough-none" style="color: rgb(0, 0, 0); font-size: 18px;">Salib</span><span class="OYPEnA text-decoration-none text-strikethrough-none" style="color: rgb(0, 0, 0); font-size: 18px;">&nbsp;adalah simbol utama dari pengorbanan dan kasih karunia Kristus, dan kehadirannya di atas kitab suci menegaskan bahwa keselamatan manusia didasarkan pada Firman Tuhan.</span></p>', 'Logo_Paroki.png', 'Publish', '2024-07-09 09:11:50', '2024-07-09 09:11:50', NULL);

